@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<div class="user-navbar">
    <img src="https://freepngimg.com/thumb/categories/1427.png" alt="Stock Market">
    <div>
        <a routerLink="/dasboard">Home</a>
        <a routerLink="/company">Company Management </a>
        <a routerLink="/stock">Stock Management </a>
        <a routerLink="/login">Login</a>
        <a routerLink="/register">Sign Up</a>
        <!-- <a routerLink="/company-info">Company Info</a> -->
        <a>Logout</a>
    </div>
</div>
